<style lang="scss" scoped>
.page-home {
	&.healthy {
		--accent: #2bde73;
	}
	&.degraded {
		--accent: #ba8200;
	}
	&.offline {
		--accent: #cfcfcf;
	}
	&.outage {
		--accent: #d71b1b;
	}

	background: #282828;
}

.image-container {
	top: 0;
	left: 0;
	right: 0;
	bottom: 0;

	svg {
		object-fit: cover;
		object-position: center;
	}
}

#Mauritius {
	fill: var(--accent);
}

[id^="cable"] path {
	stroke-dasharray: 50;
	animation: dash 2s linear reverse infinite;
	stroke: var(--accent);
}

.degraded {
	[id^="cable"] path {
		animation-duration: 30s;
	}
}
.outage {
	[id^="cable"] path {
		animation-duration: 60s;
	}
}
.offline {
	[id^="cable"] path {
		animation-duration: 500s;
	}
}

@keyframes dash {
	to {
		stroke-dashoffset: 1000;
	}
}

[id^="cable"]:hover {
	path {
		stroke: black;
		cursor: pointer;
	}
}

.real-time {
	position: absolute;
	bottom: 0;
	left: 0;
}

.label {
	@apply font-bold tracking-widest uppercase text-gray-500;
}

.value {
	@apply text-5xl mb-5;
	color: var(--accent);
	line-height: 1;
}
</style>
