		<div class="relative">
			<h1 class="md:text-4xl px-3 my-3 bg-black inline-block font-bold relative">Mauritius Sea Cables</h1>
			<br />
			<p
				class="tracking-wider relative px-3 bg-black inline-block"
			>Health Status of submarine cables connected to Mauritius</p>
			<br />
			<p class="tracking-wider relative px-3 bg-black inline-block">
				All data are unofficial. Inspired by
				<a
					href="https://baliseacable.com"
					target="_blank"
					class="underline"
				>baliseacable</a>
			</p>
			<br />
			<p class="tracking-wider relative px-3 bg-black inline-block">
				Project is open source and under construction
				<a
					href="https://github.com/MrSunshyne/mauritius-sea-cable"
					target="_blank"
					class="underline"
				>on GitHub</a>
			</p>
		</div>
		<div class="relative real-time p-8">
			<div class="label">
				//showing sample dat
				<select name="health" class="health text-black p-2" v-model="health">
					<option value="healthy">Healthy</option>
					<option value="degraded">Degraded</option>
					<option value="offline">Offline</option>
					<option value="outage">Outage</option>
				</select>
			</div>
			<div class="label">Upload</div>
			<div class="value upload">{{ info.upload }}</div>
			<div class="label">Download</div>
			<div class="value download">{{ info.download}}</div>
			<div class="label">Ping ~</div>
			<div class="value ping">{{ info.ping }}</div>
		</div>
	</div>
</template>

<script>
export default {
	data() {
		return {
			health: "healthy",
			info: null
		};
	},
	computed: {},
	methods: {
		loadStatus() {
			fetch("/status.json")
				.then(json => json.json())
				.then(response => {
					this.info = response[0];
				});
		}
	},
	mounted() {
		this.loadStatus();
	}
};
</script>